import React from 'react';
import Usuario from "../../Utils/Img/ilustraciones/users.svg";
import ReactDOM from 'react-dom';

import './cajainicio.css';

function Cajainicio() {
  return (
    <div className="cajainicio">
    <h1 id="Tittle">¿Quién eres?</h1>
      <p id="frase">Elige una de las opciones para el ingreso </p>

      <p id="frase">
           <img id="img3" src={usuario} alt="Esta es la ilustración" />
        </p>>

    <p id="frase">
        <div className="Botones">
                      <Link exact to="/">
                          <button>Acompañante </button>
                       </Link>
                 </div>
        </p>


             

</div>

   
  );
}

export default Cajainicio;
